export default function CounterItem(props) {
  const { id, count } = props;
  return (
    <>
      <div>
        <li>
          {count}
          <br></br>
          <button onClick={handleInc}>Inc</button>
          <button onClick={handleDec}>Dec</button>
          <button onClick={handleRes}>Reset</button>
        </li>
      </div>
    </>
  );
}
